import React from "react";
import "./App.css";

function App() {
  const [data, setData] = React.useState(null);

  return (
    <div className="App">
      <header className="App-header">
        <p>{!data ? "Loading..." : data}</p>
      </header>
    </div>
  );
}

export default App;
